import React from 'react';
import './style.css';

const Courses = () => {
    const courses = [
      "CC50: Introdução à Ciência da Computação - O Curso de Harvard, no Brasil (Certificado)",
      "Formação Cybersecurity Specialist (Certificado)",
      "Formação Linux Fundamentals (Certificado)",
      "Formação React Developer (Certificado)",
      "Aceleração Internacional DIO - Integrating SQL Databases with Python and MongoDB (Certificado)",
      "Potência Tech Angular Developer - Powered by iFood (Certificado)",
      "Orange Tech + BackEnd (Certificado)",
      "Potência Tech powered by iFood | Ciências de Dados com Python (Certificado)",
      "Bootcamp Cloud AWS (Certificado)",
      "Descubra a Nuvem AWS - Nexa Resources (Certificado)",
      "Desenvolvimento Java com Cloud AWS (Certificado)",
      "Potência Tech iFood - Desenvolvimento de Jogos (Certificado)",
      "Banco PAN Java Developer (Certificado)",
      "Bootcamp Microsoft Dynamics 365 (Certificado)"
    ];

    return (
      <section className='cources'>
        <h2>Cursos</h2>
        <ul>
          {courses.map((course, index) => (
            <li key={index}>{course}</li>
          ))}
        </ul>
      </section>
    );
  }


export default Courses;
